    public static Pokemon register(int id, String name, int height, int hp, int attack, int defence, int speed, int base_exp,
                                   List<PokemonType> types, List<PokemonMove> normal_moves, List<PokemonMove> t1_moves, List<PokemonMove> t2_moves){
        Pokemon pokemon = new Pokemon(id, name, height, hp, attack, defence, speed, base_exp, types, normal_moves, t1_moves, t2_moves);
        hoennPokemons.add(pokemon);
        return pokemon;
    }
